    false,nt"url": null,nt"notes": "The TIGER/Line Files are shapefiles and
    related database files (.dbf) that are an extract of selected geographic and cartographic
    information from the U.S. Census Bureau's Master Address File / Topologically Integrated
    Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents
    a seamless national file with no overlaps or gaps between parts, however, each TIGER/Line
    File is designed to stand alone as an independent data set, or they can be combined
    to cover the entire nation.  School Districts are single-purpose administrative
    units within which local officials provide public educational services for the area's
    residents.  The Census Bureau obtains the boundaries, names, local education agency
    codes, grade ranges, and school district levels for school districts from State
    officials for the primary purpose of providing the U.S. Department of Education
    with estimates of the number of children in poverty within each school district.
     This information serves as the basis for the Department of Education to determine
    the annual allocation of Title I funding to States and school districts.  TIGER/Line
    Files include separate shapefiles for elementary, secondary, and unified school
    districts.  The 2010 Census school district boundaries are those in effect for the
    2009-2010 school year.  n",nt"license_title": null,nt"extras": [{ntt"key":
